    //console.log([link, size])
    if (size === undefined) {
      size = this.size.normal
    }
    else if (typeof(size) === 'object') {
      // it is a img element
      size = this.getImageElementSize(size)
    }
    
    if (link.indexOf('/s' + size + '/') > 10) {
      return this.changeProtocol(link)
    }
    let baseUrl = this.getBaseUrl(link)
